import http from "./http";

const getPublications = async ({
  id,
  user,
  title,
  created_at,
  adress,
  price,
  available,
  description,
  img_url,
}) => {
  let baseQuery = "available_bikes?select=*";
  return http.get(baseQuery);
};

export default getPublications;
